export default function Footer() {
    return (
        <div className="footer">
            <div className="footer-text">
                <p>Copyright &copy; 2024 by Dana Kenzhaliyeva</p>
            </div>

            <div className="footer-iconTop">
                <a href="#"><i class='bx bxs-up-arrow'></i></a>
            </div>
        </div>
    )
}
